import './style.css'

import * as React from "react";
import { Link } from 'react-router-dom'

export default function ResetPassword () {
    return (
        <div className='container'>
            <form className='form-reset'>
            <fieldset className='form-group__reset'>
                <i class="bi bi-envelope-fill login__icon"></i>
                    <input type="email" className='reset__pass' placeholder='Digite seu e-mail para recuperar a senha'/>
            </fieldset>
            </form>
        </div>
    )
}
